By using this mode,you will be able to:
 - Record video in frame rates higher than 30 fps;

 Meanwhile, you might lose the abilities of:
 - Using our color management tools;
 - Audio recording management;
 - Being notified about frame drop;
 - Exporting cropped video;
 - Saving metadata of video;
 - Some other features provided by Protake.
